  //   { name: 'Green Pepper', id: 'green-pepper', isChecked: false }],
  //   size: "Medium",
  // }]
  return (
    <>
      <Nav />
      <Route exact path="/">
        <Home />
      </Route>
      <Route exact path="/order">
        <OrderForm order={order} setOrder={setOrder} />
      </Route>
      <Route exact path="/cart">
        <Cart order={order} />
      </Route>
    </>
  );
};
export default App;
